01395 bool XFILEJSON::DecodeAllLines()
01396 {
01397   if(root) delete root;
01398 
01399   if(!GetAllInOneLine(all)) return false;
01400 
01401   DeleteAllLines();
01402 
01403   //--------------------------------------------------------
01404   // Search Object Root
01405 
01406   int positionbracket = 0;
01407   int positionbrace   = 0;
01408   int position        = 0;
01409 
01410   if(!SearchControlCharacter(XFILEJSONCONTROLCHAR_OPENBRACKET, positionbracket)) positionbracket = 100000000;
01411   if(!SearchControlCharacter(XFILEJSONCONTROLCHAR_OPENBRACE  , positionbrace))   positionbrace   = 100000000;
01412 
01413   if(positionbracket > positionbrace)  position = positionbrace + 1;  else position =  positionbracket;
01414 
01415   root = new XFILEJSONOBJECT();
01416   if(!root) return false;
01417 
01418   bool status = DecodeObject(position, true, root);
01419 
01420   all.Empty();
01421 
01422   if(!status)
01423     {
01424       delete root;
01425       root = NULL;
01426     }
01427 
01428   return status;
01429 }
