01565         {
01566           XFILEJSONVALUE* value = (XFILEJSONVALUE*)array->GetValues()->Get(c);
01567           if(value)
01568             {
01569               switch(value->GetType())
01570                 {
01571                   case XFILEJSONVALUETYPE_OBJECT  :
01572                   case XFILEJSONVALUETYPE_ARRAY   : { XFILEJSONOBJECT* subobject = GetObjectSubValue(name, value);
01573                                                       if(subobject) return subobject;
01574                                                     }
01575                                                     break;
01576                                         default   : break;
01577                 }
01578             }
01579         }
01580     }
01581    else
01582     {
01583       XFILEJSONOBJECT* object = _startobject;
01584       if(!object) return NULL;
01585 
01586       if(!object->GetValues()) return NULL;
01587 
01588       for(int c=0; c<(int)object->GetValues()->GetSize();c++)
01589         {
01590           XFILEJSONVALUE* value = (XFILEJSONVALUE*)object->GetValues()->Get(c);
01591           if(value)
01592             {
01593               switch(value->GetType())
01594                 {
01595                   case XFILEJSONVALUETYPE_OBJECT  :
01596                   case XFILEJSONVALUETYPE_ARRAY   : { XFILEJSONOBJECT* subobject = GetObjectSubValue(name, value);
01597                                                       if(subobject) return subobject;
01598                                                     }
01599                                                     break;
01600                                         default   : break;
01601                 }
01602             }
