01652           if((type == XFILEJSONVALUETYPE_OBJECT) || (type ==  XFILEJSONVALUETYPE_ARRAY))
01653             {
01654               value = GetValue(name, (XFILEJSONOBJECT*)value->GetValuePointer());
01655               if(value) return value;
01656             }
01657            else
01658             {
01659               if(value->GetName())
01660                 {
01661                   if(!value->GetName()->Compare(name)) return value;
01662                 }
01663             }
01664         }
01665     }
01666 
01667   return NULL;
01668 }
