01755 XFILEJSONOBJECT* XFILEJSON::GetObjectSubValue(XCHAR* name, XFILEJSONVALUE* value)
01756 {
01757   XFILEJSONVALUETYPE type = value->GetType();
01758   if(value->GetName())
01759     {
01760       if(!value->GetName()->Compare(name))
01761         {
01762           switch(type)
01763             {
01764               case XFILEJSONVALUETYPE_OBJECT  :
01765               case XFILEJSONVALUETYPE_ARRAY   : return (XFILEJSONOBJECT*)value->GetValuePointer();
01766 
01767                                     default   : return NULL;
01768           }
01769         }
01770     }
01771 
01772   switch(type)
01773     {
01774       case XFILEJSONVALUETYPE_OBJECT  : { XFILEJSONOBJECT* subobject = GetObject(name, (XFILEJSONOBJECT*)value->GetValuePointer());
01775                                           if(subobject) return subobject;
01776                                         }
01777                                         break;
01778 
01779       case XFILEJSONVALUETYPE_ARRAY   : { XFILEJSONARRAY* subarray = (XFILEJSONARRAY*)value->GetValuePointer();
01780                                           if(subarray)
01781                                             {
01782                                               for(XDWORD d=0; d<subarray->GetValues()->GetSize(); d++)
01783                                                 {
01784                                                   XFILEJSONVALUE* subvalue = (XFILEJSONVALUE*)subarray->GetValues()->Get(d);
01785                                                   if(subvalue)
01786                                                     {
01787                                                       XFILEJSONOBJECT* subobject = GetObjectSubValue(name, subvalue);
01788                                                       if(subobject) return subobject;
01789                                                     }
01790                                                 }
01791                                             }
01792                                         }
01793                                         break;
01794 
01795                             default   : return NULL;
01796     }
01797 
01798   return NULL;
01799 }
