01815 bool XFILEJSON::DecodeObject(int& position, bool isobject, XFILEJSONOBJECT* object)
01816 {
01817   if(!object) return false;
01818 
01819   while(1)
01820     {
01821       XFILEJSONCONTROLCHAR ctrlchar;
01822 
01823       XFILEJSONVALUE* value = new XFILEJSONVALUE();
01824       if(!value) return false;
01825 
01826       if(isobject)
01827         {
01828           XSTRING name;
01829           int     checkposition = position;
01830 
01831           ctrlchar = SearchNextControlCharacter(checkposition);
01832           if(ctrlchar == XFILEJSONCONTROLCHAR_QUOTE)         
01833             {
01834               if(GetString(checkposition, name))
01835                 {
01836 
01837                 }
01838 
01839               position = checkposition;
01840             }
01841 
01842           value->SetName(name);
01843 
01844           if(!name.IsEmpty())
01845             {
01846               ctrlchar = SearchNextControlCharacter(position);
01847               if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
01848                 {
01849                   delete value;
01850                   return false;
01851                 }
01852 
01853               position++;
01854             }
01855         }
01856 
01857       ctrlchar = SearchNextControlCharacter(position);
01858       switch(ctrlchar)
01859         {
01860           case XFILEJSONCONTROLCHAR_OPENBRACE     : { XFILEJSONOBJECT* newobject = new XFILEJSONOBJECT();
01861                                                       if(!object) return false;
01862 
01863                                                       value->Set(newobject);
01864 
01865                                                       position++;
01866 
01867                                                       if(!DecodeObject(position, true, newobject))
01868                                                         {
01869                                                           delete value;
01870                                                           return false;
01871                                                         }
01872 
01873                                                       object->GetValues()->Add(value);
01874                                                     }
01875                                                     break;
01876 
01877           case XFILEJSONCONTROLCHAR_OPENBRACKET   : { XFILEJSONARRAY* newarray = new XFILEJSONARRAY();
01878                                                       if(!object) return false;
01879 
01880                                                       value->Set(newarray);
01881 
01882                                                       position++;
01883 
01884                                                       if(!DecodeObject(position,false,(XFILEJSONOBJECT*)newarray))
01885                                                         {
01886                                                           delete value;
01887                                                           return false;
01888                                                         }
01889 
01890                                                       object->GetValues()->Add(value);
01891                                                     }
01892                                                     break;
01893 
01894           case XFILEJSONCONTROLCHAR_NUMBER        : { XSTRING valuestring;
01895                                                       bool    special = false;
01896 
01897                                                       GetNumber(position, valuestring, special);
01898 
01899                                                       if(!special)
01900                                                         {
01901                                                           int integer = 0;
01902 
01903                                                           valuestring.UnFormat(__L("%d"),&integer);
01904                                                           value->Set(integer);
01905                                                         }
01906                                                        else
01907                                                         {
01908                                                           double floating = 0.0f;
01909 
01910                                                           valuestring.UnFormat(__L("%f"), &floating);
01911 
01912                                                           value->Set((float)floating);
01913                                                         }
01914 
01915                                                       object->GetValues()->Add(value);
01916                                                     }
01917                                                     break;
01918 
01919           case XFILEJSONCONTROLCHAR_TEXT          : { XSTRING valuestring;
01920 
01921                                                       GetText(position, valuestring);
01922 
01923                                                       valuestring.ToUpperCase();
01924                                                       
01925                                                       value->Set();
01926 
01927                                                       if(!valuestring.Compare(__L("TRUE")))  value->Set(true);
01928                                                       if(!valuestring.Compare(__L("FALSE"))) value->Set(false);
01929                                                       
01930                                                       if(!valuestring.Compare(__L("null")))  value->Set();
01931 
01932                                                       object->GetValues()->Add(value);
01933                                                     }
01934                                                     break;
01935 
01936           case XFILEJSONCONTROLCHAR_QUOTE         : { XSTRING valuestring;
01937 
01938                                                       GetString(position,valuestring);
01939 
01940                                                       value->Set(valuestring);
01941 
01942                                                       object->GetValues()->Add(value);
01943                                                     }
01944                                                     break;
01945 
01946           case XFILEJSONCONTROLCHAR_CLOSEBRACE    :
01947           case XFILEJSONCONTROLCHAR_CLOSEBRACKET  : delete value;
01948                                                     break;
01949 
01950           case XFILEJSONCONTROLCHAR_NOTCONTROL    :
01951                                         default   : delete value;
01952                                                     return false;
01953 
01954         }
01955 
01956 
01957       ctrlchar = SearchNextControlCharacter(position);
01958       if(position != -1)
01959         {
01960           if(isobject)
01961             {
01962               if(ctrlchar==XFILEJSONCONTROLCHAR_CLOSEBRACE)
01963                 {
01964                   position++;
01965                   break;
01966                 }
01967                else
01968                 {
01969                   if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
01970                     {
01971                       return false;
01972                     }
01973                 }
01974             }
01975            else
01976             {
01977               if(ctrlchar==XFILEJSONCONTROLCHAR_CLOSEBRACKET)
01978                 {
01979                   position++;
01980                   break;
01981                 }
01982                else
01983                 {
01984                   if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
01985                     {
01986                       return false;
01987                     }
01988                 }
01989             }
01990 
01991           ctrlchar = SearchNextControlCharacter(position);
01992           if(ctrlchar!=XFILEJSONCONTROLCHAR_COMMA)
01993             {
01994               return false;
01995             }
01996            else
01997             {
01998               //-----------------------------------
01999               // COMMA is ADD to end (BAD JSON format)
02000 
02001               position++;
02002 
02003               ctrlchar = SearchNextControlCharacter(position);
02004               if(isobject)
02005                 {
02006                   if(ctrlchar==XFILEJSONCONTROLCHAR_CLOSEBRACE)
02007                     {
02008                       position++;
02009                       break;
02010                     }
02011                    else
02012                     {
02013                       if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
02014                         {
02015                           return false;
02016                         }
02017                     }
02018                 }
02019                else
02020                 {
02021                   if(ctrlchar==XFILEJSONCONTROLCHAR_CLOSEBRACKET)
02022                     {
02023                       position++;
02024                       break;
02025                     }
02026                    else
02027                     {
02028                       if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
02029                         {
02030                           return false;
02031                         }
02032                     }
02033                 }
02034             }
02035         }
02036        else
02037         {
02038           break;
02039         }
02040     }
02041 
02042   //XTRACE_PRINTCOLOR(2, __L("%d"), position);
02043 
02044   return true;
02045 }
