02047 
02059 XFILEJSONCONTROLCHAR XFILEJSON::CheckControlCharacter(XCHAR character)
02060 {
02061   XFILEJSONCONTROLCHAR ctrlchar;
02062 
02063   switch(character)
02064     {
02065       case __C('{')  : ctrlchar = XFILEJSONCONTROLCHAR_OPENBRACE;     break;
02066       case __C('}')  : ctrlchar = XFILEJSONCONTROLCHAR_CLOSEBRACE;    break;
02067       case __C('[')  : ctrlchar = XFILEJSONCONTROLCHAR_OPENBRACKET;   break;
02068       case __C(']')  : ctrlchar = XFILEJSONCONTROLCHAR_CLOSEBRACKET;  break;
02069       case __C('\"') : ctrlchar = XFILEJSONCONTROLCHAR_QUOTE;         break;
02070       case __C(',')  : ctrlchar = XFILEJSONCONTROLCHAR_COMMA;         break;
02071       case __C(':')  : ctrlchar = XFILEJSONCONTROLCHAR_COLON;         break;
02072       case __C('\\') : ctrlchar = XFILEJSONCONTROLCHAR_BLACKSLASH;    break;
02073 
02074       case __C('0')  :
02075       case __C('1')  :
02076       case __C('2')  :
02077       case __C('3')  :
02078       case __C('4')  :
02079       case __C('5')  :
02080       case __C('6')  :
02081       case __C('7')  :
02082       case __C('8')  :
02083       case __C('9')  :
02084       case __C('-')  : ctrlchar = XFILEJSONCONTROLCHAR_NUMBER;        break;
02085 
02086       case __C('.')  :
02087       case __C('+')  :
02088       case __C('e')  :
02089       case __C('E')  : ctrlchar = XFILEJSONCONTROLCHAR_NUMBERSPECIAL; break;
02090 
02091       case __C('\t') :
02092       case __C('\r') :
02093       case __C('\n') :
02094       case __C(' ')  : ctrlchar = XFILEJSONCONTROLCHAR_NOTCONTROL;    break;
02095 
02096            default   : ctrlchar = XFILEJSONCONTROLCHAR_TEXT;          break;
02097     }
02098 
02099   return ctrlchar;
02100 }
