02114 XCHAR XFILEJSON::GetControlCharacter(XFILEJSONCONTROLCHAR ctrlchar)
02115 {
02116   switch(ctrlchar)
02117     {
02118       case XFILEJSONCONTROLCHAR_OPENBRACE     : return __C('{');
02119       case XFILEJSONCONTROLCHAR_CLOSEBRACE    : return __C('}');
02120       case XFILEJSONCONTROLCHAR_OPENBRACKET   : return __C('[');
02121       case XFILEJSONCONTROLCHAR_CLOSEBRACKET  : return __C(']');
02122       case XFILEJSONCONTROLCHAR_QUOTE         : return __C('\"');
02123       case XFILEJSONCONTROLCHAR_COMMA         : return __C(',');
02124       case XFILEJSONCONTROLCHAR_COLON         : return __C(':');
02125       case XFILEJSONCONTROLCHAR_BLACKSLASH    : return __C('\\');
02126                                      default  : break;
02127     }
02128 
02129   return 0;
02130 }
