02169 XFILEJSONCONTROLCHAR XFILEJSON::SearchNextControlCharacter(int& position)
02170 {
02171   for(int c=position;c<(int)all.GetSize();c++)
02172     {
02173       XFILEJSONCONTROLCHAR ctrlchar;
02174 
02175       ctrlchar = CheckControlCharacter(all.Get()[c]);
02176       if(ctrlchar != XFILEJSONCONTROLCHAR_NOTCONTROL)
02177         {
02178           position = c;
02179           return ctrlchar;
02180         }
02181     }
02182 
02183   position = XSTRING_NOTFOUND;
02184 
02185   return XFILEJSONCONTROLCHAR_NOTCONTROL;
02186 }
