02201 bool XFILEJSON::SearchControlCharacter(XFILEJSONCONTROLCHAR ctrlchar, int& position)
02202 {
02203   for(int c=position;c<(int)all.GetSize();c++)
02204     {
02205       XFILEJSONCONTROLCHAR _ctrlchar;
02206 
02207       _ctrlchar = CheckControlCharacter(all.Get()[c]);
02208       if(_ctrlchar == ctrlchar)
02209         {
02210           position = c;
02211           return true;
02212         }
02213     }
02214 
02215   position = XSTRING_NOTFOUND;
02216   return false;
02217 }
