02233 bool XFILEJSON::GetNumber(int& position, XSTRING& string, bool& special)
02234 {
02235   string.Empty();
02236 
02237   special = false;
02238 
02239   for(int c=position;c<(int)all.GetSize();c++)
02240     {
02241       XFILEJSONCONTROLCHAR ctrlchar;
02242 
02243       ctrlchar = CheckControlCharacter(all.Get()[c]);
02244       if((ctrlchar == XFILEJSONCONTROLCHAR_NUMBER)||(ctrlchar == XFILEJSONCONTROLCHAR_NUMBERSPECIAL))
02245         {
02246           string += all.Get()[c];
02247           if(ctrlchar == XFILEJSONCONTROLCHAR_NUMBERSPECIAL) special = true;
02248 
02249         }
02250        else
02251         {
02252           position = c;
02253           break;
02254         }
02255     }
02256 
02257   return string.IsEmpty()?false:true;
02258 }
