02273 bool XFILEJSON::GetText(int& position, XSTRING& string)
02274 {
02275   string.Empty();
02276 
02277   for(int c=position;c<(int)all.GetSize();c++)
02278     {
02279       XFILEJSONCONTROLCHAR ctrlchar;
02280 
02281       ctrlchar = CheckControlCharacter(all.Get()[c]);
02282       if((ctrlchar == XFILEJSONCONTROLCHAR_TEXT) ||(ctrlchar == XFILEJSONCONTROLCHAR_NUMBERSPECIAL))
02283         {
02284           string += all.Get()[c];
02285         }
02286        else
02287         {
