02296 
02309 bool XFILEJSON::GetString(int& position, XSTRING& string)
02310 {
02311   string.Empty();
02312 
02313   XFILEJSONCONTROLCHAR ctrlchar;
02314 
02315   //----------------------------------
02316   // First Quote
02317   ctrlchar = CheckControlCharacter(all.Get()[position]);
02318   if(ctrlchar != XFILEJSONCONTROLCHAR_QUOTE) return false;
02319 
02320   position++;
02321 
02322   bool slashcontrol = false;
02323   bool exit         = false;
02324 
02325   for(int c=position;c<(int)all.GetSize();c++)
02326     {
02327       ctrlchar = CheckControlCharacter(all.Get()[c]);
02328 
02329       switch(ctrlchar)
02330         {
02331           case XFILEJSONCONTROLCHAR_NOTCONTROL    :
02332           case XFILEJSONCONTROLCHAR_OPENBRACE     :
02333           case XFILEJSONCONTROLCHAR_CLOSEBRACE    :
02334           case XFILEJSONCONTROLCHAR_OPENBRACKET   :
02335           case XFILEJSONCONTROLCHAR_CLOSEBRACKET  :
02336           case XFILEJSONCONTROLCHAR_COMMA         :
02337           case XFILEJSONCONTROLCHAR_COLON         :
02338           case XFILEJSONCONTROLCHAR_NUMBER        :
02339           case XFILEJSONCONTROLCHAR_NUMBERSPECIAL :
02340           case XFILEJSONCONTROLCHAR_TEXT          : string += all.Get()[c];
02341                                                     slashcontrol = false;
02342                                                     break;
02343 
02344           case XFILEJSONCONTROLCHAR_QUOTE         : if(slashcontrol)
02345                                                       {
02346                                                         string += all.Get()[c];
02347                                                         slashcontrol = false;
02348 
02349                                                       }
02350                                                      else exit = true;
02351                                                     break;
02352 
02353           case XFILEJSONCONTROLCHAR_BLACKSLASH    : slashcontrol = true;
02354                                                     string += all.Get()[c];
02355                                                     break;
02356         }
02357 
02358       if(exit)
02359         {
02360           position = (c + 1);
02361           break;
02362         }
02363     }
02364 
02365   return string.IsEmpty()?false:true;
02366 }
