02382 bool XFILEJSON::AddTabs(int level, int spacetabs, XSTRING& string)
02383 {
02384   if(spacetabs<=0) return false;
02385 
02386   for(int c=0;c<level;c++)
02387     {
02388       for(int d=0;d<spacetabs;d++)
02389         {
02390           string += __L(" ");
02391         }
02392     }
02393 
02394   return true;
02395 }
