02411 bool XFILEJSON::EncodeObject(bool isobject, XFILEJSONOBJECT* object, bool istabulatedline)
02412 {
02413   if(!object) return false;
02414 
02415   XSTRING line;
02416 
02417   if(istabulatedline)
02418     {
02419       AddTabs(encodelevel,XFILEJSON_SPACETABS,line);
02420       encodelevel++;
02421     }
02422 
02423   AddControlCharacter(isobject?XFILEJSONCONTROLCHAR_OPENBRACE:XFILEJSONCONTROLCHAR_OPENBRACKET, line);
02424   AddLine(line);
02425   //XTRACE_PRINTCOLOR(0,line.Get());
02426 
02427   for(int c=0;c<(int)object->GetValues()->GetSize();c++)
02428     {
02429       XFILEJSONVALUE* value = (XFILEJSONVALUE*)(object->GetValues()->Get(c));
02430       if(value)
02431         {
02432           line.Empty();
02433           AddTabs(encodelevel, XFILEJSON_SPACETABS, line);
02434 
02435           XSTRING* name = value->GetName();
02436           if(name)
02437             {
02438               if(!name->IsEmpty())
02439                 {
02440                   XSTRING line2;
02441 
02442                   line2.Format(__L("%c%s%c : "), GetControlCharacter(XFILEJSONCONTROLCHAR_QUOTE), name->Get() , GetControlCharacter(XFILEJSONCONTROLCHAR_QUOTE));
02443                   line+=line2;
02444                 }
02445             }
02446     
02447           switch(value->GetType())
02448             {              
02449               case XFILEJSONVALUETYPE_NULL            : line += __L("null");
02450                                                         break;
02451 
02452 
02453 
02454               case XFILEJSONVALUETYPE_STRING          : { XSTRING  ptrvaluestring = value->GetValueString();
02455                                                           XSTRING  valuestring;
02456                                                          
02457                                                           valuestring.Format(__L("%c%s%c"), GetControlCharacter(XFILEJSONCONTROLCHAR_QUOTE), ptrvaluestring.Get(), GetControlCharacter(XFILEJSONCONTROLCHAR_QUOTE));
02458                                                           line += valuestring.Get();
02459                                                         }
02460                                                         break;              
02461 
02462               case XFILEJSONVALUETYPE_OBJECT          : { XFILEJSONOBJECT* newobject = (XFILEJSONOBJECT*)(value->GetValuePointer());
02463                                                           if(newobject)
02464                                                             {
02465                                                               if((!line.IsEmpty()) && line.HaveCharacters())
02466                                                                 {
02467                                                                   AddLine(line);
02468                                                                   //XTRACE_PRINTCOLOR(0,line.Get());
02469                                                                 }
02470 
02471                                                               if(!EncodeObject(true,newobject,istabulatedline)) return false;
02472                                                               line.Empty();
02473                                                             }
02474                                                         }
02475                                                         break;
02476 
02477               case XFILEJSONVALUETYPE_ARRAY           : { XFILEJSONARRAY* newarray = (XFILEJSONARRAY*)(value->GetValuePointer());
02478                                                           if(newarray)
02479                                                             {
02480                                                               if((!line.IsEmpty()) && line.HaveCharacters())
02481                                                                 {
02482                                                                   AddLine(line);
02483                                                                   //XTRACE_PRINTCOLOR(0,line.Get());
02484                                                                 }
02485 
02486                                                               if(!EncodeObject(false,(XFILEJSONOBJECT*)newarray,istabulatedline)) return false;
02487                                                               line.Empty();
02488                                                             }
02489                                                         }
02490                                                         break;  
02491 
02492                                     default           : { XSTRING valuestring;
02493 
02494                                                           value->GetValue()->ToString(valuestring);
02495 
02496                                                           line += valuestring.Get();   
02497                                                         }
02498                                                         break;  
02499         
02500             }
02501         }
02502 
02503       if(c!=(int)(object->GetValues()->GetSize()-1))
02504         {
02505           if(line.IsEmpty()) AddTabs(encodelevel,XFILEJSON_SPACETABS,line);
02506 
02507           AddControlCharacter(XFILEJSONCONTROLCHAR_COMMA, line);
02508         }
02509 
02510       if(!line.IsEmpty())
02511         {
02512           AddLine(line);
02513           //XTRACE_PRINTCOLOR(0,line.Get());
02514         }
02515 
02516       line.Empty();
02517     }
02518 
02519   line.Empty();
02520 
02521   if(istabulatedline)
02522     {
02523       encodelevel--;
02524       AddTabs(encodelevel,XFILEJSON_SPACETABS,line);
02525     }
02526 
02527   AddControlCharacter(isobject?XFILEJSONCONTROLCHAR_CLOSEBRACE:XFILEJSONCONTROLCHAR_CLOSEBRACKET, line);
02528   AddLine(line);
02529 
02530   //XTRACE_PRINTCOLOR(0,line.Get());
02531 
02532   return true;
02533 }
